import React from 'react';
import './Header.scss';
import logo from '../../assets/logo/inStock-logo.svg';
import { NavLink } from 'react-router-dom';


const header = () => {
  return (
    <header className="header">
        <img className="header__logo" src={logo} alt="logo" />
      <div className="header__wrapper">
        <NavLink to="/warehouse"
        activeStyle={{
          backgroundColor: "#13182C",
          color: "white",
          width: "10.25rem",
          borderRadius: "20px",
          height: "2.25rem",
          textAlign: "center"
        }} >Warehouses</NavLink>
        <NavLink to="/inventory"
        activeStyle= {{
          backgroundColor: "#13182C",
          color: "white",
          width: "10.25rem",
          borderRadius: "20%",
          height: "2.25rem",
          paddingLeft: "0.5rem",
          paddingRight: "0.5rem"
        }} ><button className="header__btn">Inventory</button></NavLink>
      </div>
    </header>
  );
};

export default header;
